import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import TestPage1 from "./page/TestPage1";

function App(props) {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/" element={TestPage1} />
        <Route path="/test2" element={TestPage2} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
